measurements.description:
One flower and one bud on one 17-cm inflorescence;
	dorsal sepal cream heavily overlaid mahogany, prominately veined darker mahogany, chartreuse proximally;
	synsepal cream overlaid mahogany proximal third and edges, veined darker mahogany, chartreuse proximally; 
	petals burgundy, chartreuse proximally, hirsute edges;
	pouch burgundy; 
	staminode chartreuse, burgundy distal edge; 
	substance firm; texture glossy.
